import { makeStyles } from "@mui/styles";

export default makeStyles({
  container: {
    height: '100vh',
    paddingTop: '120px',
  },
  isEmpty: {
    background: 'rgb(145 145 145 / 21%)',
    width: '400px',
    margin:'40px',
    '&:first-child': {
      color: 'purple', marginLeft: '40px'
    }
  }
});
